import{f as n,o as s,c as a,b as e,g as t,h as p,e as o,d as c}from"./app.62ebd6cc.js";const l='{"title":"快速开始","description":"","frontmatter":{"title":"快速开始"},"headers":[{"level":2,"title":"用法","slug":"用法"},{"level":3,"title":"完整导入","slug":"完整导入"},{"level":3,"title":"按需导入","slug":"按需导入"},{"level":2,"title":"快捷搭建项目模板","slug":"快捷搭建项目模板"},{"level":3,"title":"Vue CLI","slug":"vue-cli"},{"level":3,"title":"使用 Starter Kit","slug":"使用-starter-kit"},{"level":2,"title":"全局配置","slug":"全局配置"},{"level":2,"title":"使用 Nuxt.js","slug":"使用-nuxt-js"},{"level":2,"title":"让我们开始吧","slug":"让我们开始吧"}],"relativePath":"zh-CN/guide/quickstart.md","lastUpdated":1631931012766}',u={},r=o('<h1 id="快速开始" tabindex="-1">快速开始 <a class="header-anchor" href="#快速开始" aria-hidden="true">#</a></h1><p>本节介绍如何在您的项目中使用 Element Plus。</p><h2 id="用法" tabindex="-1">用法 <a class="header-anchor" href="#用法" aria-hidden="true">#</a></h2><h3 id="完整导入" tabindex="-1">完整导入 <a class="header-anchor" href="#完整导入" aria-hidden="true">#</a></h3><p>如果你对打包后的文件大小不是很在乎，那么使用完整导入会更方便。</p><div class="language-typescript"><pre><code><span class="token keyword">import</span> <span class="token punctuation">{</span> createApp <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">&#39;vue&#39;</span>\n<span class="token keyword">import</span> ElementPlus <span class="token keyword">from</span> <span class="token string">&#39;element-plus&#39;</span>\n<span class="token keyword">import</span> <span class="token string">&#39;element-plus/dist/index.css&#39;</span>\n<span class="token keyword">import</span> App <span class="token keyword">from</span> <span class="token string">&#39;./App.vue&#39;</span>\n\n<span class="token keyword">const</span> app <span class="token operator">=</span> <span class="token function">createApp</span><span class="token punctuation">(</span>App<span class="token punctuation">)</span>\n\napp<span class="token punctuation">.</span><span class="token function">use</span><span class="token punctuation">(</span>ElementPlus<span class="token punctuation">)</span>\napp<span class="token punctuation">.</span><span class="token function">mount</span><span class="token punctuation">(</span><span class="token string">&#39;#app&#39;</span><span class="token punctuation">)</span>\n</code></pre></div><h3 id="按需导入" tabindex="-1">按需导入 <a class="header-anchor" href="#按需导入" aria-hidden="true">#</a></h3><p>您需要使用额外的插件来自动导入用了的组件。</p>',8),i={id:"自动导入-推荐",tabindex:"-1"},k=c("自动导入 "),d=c("推荐"),h=c(),g=e("a",{class:"header-anchor",href:"#自动导入-推荐","aria-hidden":"true"},"#",-1),m=o('<p>首先你需要安装 <code>unplugin-vue-components</code>。</p><div class="language-shell"><pre><code><span class="token function">npm</span> <span class="token function">install</span> unplugin-vue-components\n</code></pre></div><p>然后将下面的代码添加到 <code>Vite</code> 或 <code>webpack</code> 的配置文件。</p><h5 id="vite" tabindex="-1">Vite <a class="header-anchor" href="#vite" aria-hidden="true">#</a></h5><div class="language-ts"><pre><code><span class="token comment">// vite.config.ts</span>\n<span class="token keyword">import</span> Components <span class="token keyword">from</span> <span class="token string">&#39;unplugin-vue-components/vite&#39;</span>\n<span class="token keyword">import</span> <span class="token punctuation">{</span> ElementPlusResolver <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">&#39;unplugin-vue-components/resolvers&#39;</span>\n\n<span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token punctuation">{</span>\n  plugins<span class="token operator">:</span> <span class="token punctuation">[</span>\n    <span class="token comment">// ...</span>\n    <span class="token function">Components</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n      resolvers<span class="token operator">:</span> <span class="token punctuation">[</span><span class="token function">ElementPlusResolver</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n    <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n  <span class="token punctuation">]</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h5 id="webpack" tabindex="-1">Webpack <a class="header-anchor" href="#webpack" aria-hidden="true">#</a></h5><div class="language-ts"><pre><code><span class="token comment">// webpack.config.js</span>\n<span class="token keyword">const</span> components <span class="token operator">=</span> <span class="token keyword">require</span><span class="token punctuation">(</span><span class="token string">&#39;unplugin-vue-components/webpack&#39;</span><span class="token punctuation">)</span>\n<span class="token keyword">const</span> <span class="token punctuation">{</span> ElementPlusResolver <span class="token punctuation">}</span> <span class="token operator">=</span> <span class="token keyword">require</span><span class="token punctuation">(</span><span class="token string">&#39;unplugin-vue-components/resolvers&#39;</span><span class="token punctuation">)</span>\n\nmodule<span class="token punctuation">.</span>exports <span class="token operator">=</span>\n  <span class="token comment">// ...</span>\n  plugins<span class="token operator">:</span> <span class="token punctuation">[</span>\n    <span class="token function">Components</span><span class="token punctuation">(</span><span class="token punctuation">{</span>\n      resolvers<span class="token operator">:</span> <span class="token punctuation">[</span><span class="token function">ElementPlusResolver</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n    <span class="token punctuation">}</span><span class="token punctuation">)</span><span class="token punctuation">,</span>\n  <span class="token punctuation">]</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span>\n</code></pre></div><p>想了解其他的打包工具(<a href="https://rollupjs.org/" target="_blank" rel="noopener noreferrer">Rollup</a>, <a href="https://cli.vuejs.org/" target="_blank" rel="noopener noreferrer">Vue CLI</a>)，请参考 <a href="https://github.com/antfu/unplugin-vue-components#readme" target="_blank" rel="noopener noreferrer">unplugin-vue-components</a>。</p><h4 id="手动导入" tabindex="-1">手动导入 <a class="header-anchor" href="#手动导入" aria-hidden="true">#</a></h4><p>Element Plus 默认支持基于 ES Module 的 <a href="https://webpack.js.org/guides/tree-shaking/" target="_blank" rel="noopener noreferrer">Tree Shaking</a>。</p><p>但是您需要安装 <a href="https://github.com/element-plus/unplugin-element-plus" target="_blank" rel="noopener noreferrer">unplugin-element-plus</a> 来进行样式导入。 如何配置请查看<a href="https://github.com/element-plus/unplugin-element-plus#readme" target="_blank" rel="noopener noreferrer">文档</a>。</p><blockquote><p>App.vue</p></blockquote><div class="language-html"><pre><code><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>template</span><span class="token punctuation">&gt;</span></span>\n  <span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>el-button</span><span class="token punctuation">&gt;</span></span>I am ElButton<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>el-button</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>template</span><span class="token punctuation">&gt;</span></span>\n<span class="token tag"><span class="token tag"><span class="token punctuation">&lt;</span>script</span><span class="token punctuation">&gt;</span></span><span class="token script"><span class="token language-javascript">\n  <span class="token keyword">import</span> <span class="token punctuation">{</span> ElButton <span class="token punctuation">}</span> <span class="token keyword">from</span> <span class="token string">&#39;element-plus&#39;</span>\n  <span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token punctuation">{</span>\n    components<span class="token operator">:</span> <span class="token punctuation">{</span> ElButton <span class="token punctuation">}</span><span class="token punctuation">,</span>\n  <span class="token punctuation">}</span>\n</span></span><span class="token tag"><span class="token tag"><span class="token punctuation">&lt;/</span>script</span><span class="token punctuation">&gt;</span></span>\n</code></pre></div><div class="language-ts"><pre><code><span class="token comment">// vite.config.ts</span>\n<span class="token keyword">import</span> ElementPlus <span class="token keyword">from</span> <span class="token string">&#39;unplugin-element-plus/vite&#39;</span>\n\n<span class="token keyword">export</span> <span class="token keyword">default</span> <span class="token punctuation">{</span>\n  plugins<span class="token operator">:</span> <span class="token punctuation">[</span><span class="token function">ElementPlus</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">]</span><span class="token punctuation">,</span>\n<span class="token punctuation">}</span>\n</code></pre></div><h2 id="快捷搭建项目模板" tabindex="-1">快捷搭建项目模板 <a class="header-anchor" href="#快捷搭建项目模板" aria-hidden="true">#</a></h2><h3 id="vue-cli" tabindex="-1">Vue CLI <a class="header-anchor" href="#vue-cli" aria-hidden="true">#</a></h3><p>我们为 Vue CLI 准备了相应的 <a href="https://github.com/element-plus/vue-cli-plugin-element-plus" target="_blank" rel="noopener noreferrer">Element Plus Vue CLI 插件</a>。 对于 <a href="https://cli.vuejs.org/" target="_blank" rel="noopener noreferrer">Vue CLI</a>，你可以用它们快速地搭建一个基于 Element Plus 的项目。</p><h3 id="使用-starter-kit" tabindex="-1">使用 Starter Kit <a class="header-anchor" href="#使用-starter-kit" aria-hidden="true">#</a></h3><p>我们提供了通用的<a href="https://github.com/element-plus/element-plus-starter" target="_blank" rel="noopener noreferrer">项目模板</a>，你可以直接使用，另外我们还提供了 Vite <a href="https://github.com/element-plus/element-plus-vite-starter" target="_blank" rel="noopener noreferrer">模板</a>。 对于 Laravel 用户，我们也准备了相应的<a href="https://github.com/element-plus/element-plus-in-laravel-starter" target="_blank" rel="noopener noreferrer">模板</a>，同样可以直接下载使用。</p><h2 id="全局配置" tabindex="-1">全局配置 <a class="header-anchor" href="#全局配置" aria-hidden="true">#</a></h2><p>当注册元素加速度时， 您可以通过一个带有 <code>大小</code> 和 的全局配置对象<code>zIndex</code> 来设置默认值 <code>大小</code> 表单组件. 和 <code>zIndex</code> 用于 弹出组件，默认值为 <code>zIndex</code> 为 <code>2000</code>。</p><p>完整引入 ElementPlus：</p><div class="language-ts"><pre><code>从 <span class="token string">&#39;vue&#39;</span> 导入 <span class="token punctuation">{</span> createApp <span class="token punctuation">}</span>\n从 <span class="token string">&#39;element-plus&#39;</span>\n从 <span class="token string">&#39;./App.vue&#39;</span> 导入应用程序\n\n<span class="token keyword">const</span> app <span class="token operator">=</span> <span class="token function">createApp</span><span class="token punctuation">(</span>App<span class="token punctuation">)</span>\napp<span class="token punctuation">.</span><span class="token function">use</span><span class="token punctuation">(</span>ElementPlus<span class="token punctuation">,</span> <span class="token punctuation">{</span> size<span class="token operator">:</span> <span class="token string">&#39;small&#39;</span><span class="token punctuation">,</span> zIndex<span class="token operator">:</span> <span class="token number">3000</span> <span class="token punctuation">}</span><span class="token punctuation">)</span>\n</code></pre></div><p>即时：</p><div class="language-ts"><pre><code>从 <span class="token string">&#39;vue&#39;</span> 导入 <span class="token punctuation">{</span> createApp <span class="token punctuation">}</span>\n从 <span class="token string">&#39;element-plus&#39;</span> 导入 <span class="token punctuation">{</span> ElButton <span class="token punctuation">}</span>\n从 &#39;<span class="token punctuation">.</span><span class="token operator">/</span>App 导入应用。\n\n<span class="token keyword">const</span> app <span class="token operator">=</span> <span class="token function">createApp</span><span class="token punctuation">(</span>App<span class="token punctuation">)</span>\napp<span class="token punctuation">.</span>config<span class="token punctuation">.</span>globalProperties。$<span class="token constant">ELEMENT</span> <span class="token operator">=</span> Power\n  <span class="token comment">// options</span>\n<span class="token punctuation">}</span>\napp<span class="token punctuation">.</span><span class="token function">use</span><span class="token punctuation">(</span>Elbutton<span class="token punctuation">)</span>\n</code></pre></div><h2 id="使用-nuxt-js" tabindex="-1">使用 Nuxt.js <a class="header-anchor" href="#使用-nuxt-js" aria-hidden="true">#</a></h2><p>按照以上设置，项目中所有拥有 <code>size</code> 属性的组件的默认尺寸均为 &#39;small&#39;，弹框的初始 z-index 为 3000。</p><div class="glitch-embed-wrap" style="height:420px;width:100%;"><iframe src="https://glitch.com/embed/#!/embed/nuxt-with-element?path=nuxt.config.js&amp;previewSize=0&amp;attributionHidden=true" alt="nuxt-with-element on glitch" style="height:100%;width:100%;border:0;"></iframe></div><h2 id="让我们开始吧" tabindex="-1">让我们开始吧 <a class="header-anchor" href="#让我们开始吧" aria-hidden="true">#</a></h2><p>我们还可以使用 <a href="https://nuxtjs.org" target="_blank" rel="noopener noreferrer">Nuxt.js</a>：</p>',30);u.render=function(o,c,l,u,f,v){const b=n("el-tag");return s(),a("div",null,[r,e("h4",i,[k,t(b,{type:"primary",style:{"vertical-align":"middle"},effect:"dark",size:"small"},{default:p((()=>[d])),_:1}),h,g]),m])};export{l as __pageData,u as default};
